import React from "react";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import BPText from "../common/BPText";
import DialogTitle from "@material-ui/core/DialogTitle";

export default function AddVendorDialog() {
  const [name, setName] = React.useState("");
  const [mobile, setMobile] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [location, setLocatiol] = React.useState("");

  const onChangeName = e => {
    console.log(e.target.value);
    //setName();
  };

  return (
    <div>
      <Dialog
        open={true}
        // onClose={handleClose}
        aria-labelledby="form-dialog-title"
      >
        <DialogTitle id="form-dialog-title">Add Vendor</DialogTitle>
        <DialogContent>
          <BPText
            autoFocus={true}
            onClick={e => onChangeName(e)}
            onBlur={e => onChangeName(e)}
            id="name"
            value={name}
            label="Vendor Name"
            type="text"
          />
          <BPText id="mobile" label="Mobile Number" type="number" />
          <BPText id="email" label="Email Address" type="email" />
          <BPText id="location" label="Location" type="text" />
        </DialogContent>
        <DialogActions>
          {/* <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleClose} color="primary">
            Add Vendor
          </Button> */}
        </DialogActions>
      </Dialog>
    </div>
  );
}
